svg.script:
    /*  */
    var a = 4;
    var counterText = document.getElementById('t1');
    var timings = [10500,3000,5000,3000,5000,3000,5000,3000,5000,3500,6500,3000,6500,3500,6500,4000,7000,4000,7000,4000,8000,7000,]

    function recurse(i) {
        processCounter();
        if(timings.length > i) setTimeout(()=>recurse(i+1),timings[i+1]);
    }
    setTimeout(x=> recurse(0),timings[0]);
    

    function processCounter(){
        counterText.textContent = a;
        if(a === 4) a = 3;
        else if(a === 3) a = 2;
        else if(a === 2) a = 1;
        else if(a === 1) a = 3;
    }
    /*  */
